import React, { useState } from 'react';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './FeedbackManagement.css';

const FeedbackManagement = () => {
  const [activeTab, setActiveTab] = useState('feedback');
  const [searchQuery, setSearchQuery] = useState('');

  // Mock data for feedback statistics
  const feedbackStats = [
    { label: '1-Star Ratings', value: 5, color: 'red' },
    { label: '5-Star Ratings', value: 60, color: 'green' },
    { label: '4-Star Ratings', value: 35, color: 'blue' },
    { label: '3-Star Ratings', value: 15, color: 'yellow' },
    { label: '2-Star Ratings', value: 10, color: 'orange' },
    { label: 'Total Feedbacks', value: 125, color: 'purple' },
    { label: 'Resolved Feedbacks', value: 75, color: 'green' },
    { label: 'Not Resolved Feedbacks', value: 50, color: 'red' }
  ];

  // Mock data for feedback list
  const feedbackList = [
    {
      id: 1,
      user: 'Ethan Harper',
      feedback: 'The property listings are very helpful.',
      date: '2024-07-26 10:30 AM',
      status: 'New',
      rating: 4,
      pushToHomepage: true
    },
    {
      id: 2,
      user: 'Olivia Bennett',
      feedback: 'I appreciate the detailed property information, but the map feature is not very accurate.',
      date: '2024-07-25 03:45 PM',
      status: 'In Progress',
      rating: 3,
      pushToHomepage: false
    },
    {
      id: 3,
      user: 'Noah Carter',
      feedback: 'The platform is user-friendly.',
      date: '2024-07-24 09:15 AM',
      status: 'Resolved',
      rating: 5,
      pushToHomepage: true
    },
    {
      id: 4,
      user: 'Ava Morgan',
      feedback: 'I found the contact information for property managers to be outdated in some listings.',
      date: '2024-07-23 01:20 PM',
      status: 'New',
      rating: 2,
      pushToHomepage: false
    },
    {
      id: 5,
      user: 'Liam Foster',
      feedback: 'The platform is great overall, but the loading times for images could be improved.',
      date: '2024-07-22 11:50 AM',
      status: 'Resolved',
      rating: 4,
      pushToHomepage: false
    }
  ];

  // Filter feedback based on search query
  const filteredFeedback = feedbackList.filter(item =>
    item.user.toLowerCase().includes(searchQuery.toLowerCase()) ||
    item.feedback.toLowerCase().includes(searchQuery.toLowerCase())
  );

  const handleSearch = (e) => {
    setSearchQuery(e.target.value);
  };

  const handlePushToHomepage = (feedbackId) => {
    console.log('Toggle push to homepage for feedback:', feedbackId);
    // Add toggle logic here
  };

  const handleRespond = (feedbackId) => {
    console.log('Respond to feedback:', feedbackId);
    // Add response logic here
  };

  const handleView = (feedbackId) => {
    console.log('View feedback:', feedbackId);
    // Add view logic here
  };

  const getStatusBadgeClass = (status) => {
    switch (status.toLowerCase()) {
      case 'new':
        return 'status-badge new';
      case 'in progress':
        return 'status-badge in-progress';
      case 'resolved':
        return 'status-badge resolved';
      default:
        return 'status-badge';
    }
  };

  const renderStars = (rating) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span key={i} className={`star ${i <= rating ? 'filled' : 'empty'}`}>
          ‚òÖ
        </span>
      );
    }
    return stars;
  };

  return (
    <div className="feedback-management-page">
      <Header />
      <div className="dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Feedback Management</h1>
          </div>
          
          <div className="feedback-management-content">
            {/* Feedback Statistics Section */}
            <section className="feedback-stats-section">
              <div className="stats-grid">
                {feedbackStats.map((stat, index) => (
                  <div key={index} className={`stat-card ${stat.color}`}>
                    <div className="stat-value">{stat.value}</div>
                    <div className="stat-label">{stat.label}</div>
                  </div>
                ))}
              </div>
            </section>

            {/* Search Section */}
            <section className="search-section">
              <div className="search-container">
                <span className="search-icon">üîç</span>
                <input
                  type="text"
                  className="search-input"
                  placeholder="Search feedback"
                  value={searchQuery}
                  onChange={handleSearch}
                />
              </div>
            </section>

            {/* Feedback List Section */}
            <section className="feedback-list-section">
              <div className="table-container">
                <table className="feedback-table">
                  <thead>
                    <tr>
                      <th>User</th>
                      <th>Feedback</th>
                      <th>Date</th>
                      <th>Status</th>
                      <th>Rating</th>
                      <th>Push to Homepage</th>
                      <th>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                    {filteredFeedback.map((item) => (
                      <tr key={item.id} className="feedback-row">
                        <td className="user-name">{item.user}</td>
                        <td className="feedback-text">{item.feedback}</td>
                        <td className="feedback-date">{item.date}</td>
                        <td className="feedback-status">
                          <span className={getStatusBadgeClass(item.status)}>
                            {item.status}
                          </span>
                        </td>
                        <td className="feedback-rating">
                          <div className="stars-container">
                            {renderStars(item.rating)}
                          </div>
                        </td>
                        <td className="push-toggle">
                          <button
                            className={`toggle-switch ${item.pushToHomepage ? 'active' : ''}`}
                            onClick={() => handlePushToHomepage(item.id)}
                          >
                            <span className="toggle-slider"></span>
                          </button>
                        </td>
                        <td className="feedback-actions">
                          {item.status === 'Resolved' ? (
                            <button 
                              className="action-btn view-btn"
                              onClick={() => handleView(item.id)}
                            >
                              View
                            </button>
                          ) : (
                            <button 
                              className="action-btn respond-btn"
                              onClick={() => handleRespond(item.id)}
                            >
                              Respond
                            </button>
                          )}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>

              {/* Pagination */}
              <div className="pagination-container">
                <div className="pagination">
                  <button className="pagination-arrow">‚Üê</button>
                  <button className="pagination-page active">1</button>
                  <button className="pagination-page">2</button>
                  <button className="pagination-page">3</button>
                  <button className="pagination-page">4</button>
                  <button className="pagination-page">5</button>
                  <button className="pagination-arrow">‚Üí</button>
                </div>
              </div>
            </section>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default FeedbackManagement;
